You can use the `Date` object in JavaScript to measure time intervals in milliseconds. Here's an example of how you can do it:

```javascript
// Record the start time
var startTime = new Date();

// Your code or operations here

// Record the end time
var endTime = new Date();

// Calculate the time interval in milliseconds
var timeInterval = endTime - startTime;

console.log("Time interval in milliseconds:", timeInterval);
```

In this example, `startTime` and `endTime` are `Date` objects representing the start and end times, respectively. Subtracting `startTime` from `endTime` will give you the time interval in milliseconds. You can then use the `console.log()` function to output the result.

Keep in mind that this method measures the time it takes for the code to execute between the `startTime` and `endTime`. If you want to measure the time between two points in your code, make sure you place the `startTime` and `endTime` recording code appropriately.

